springmvc/form.html.body:
Form
Dalam tutorial Mustache, kita ada membuat form untuk login.
Sekarang kita akan melihat bagaimana untuk mengambil input tersebut.
Semasa menghantar form, konsepnya sama seperti menghantar request body, cuma
dalam format yang berbeza. Untuk mengambil input daripada form, kita perlu
menggunakan annotation @ModelAttribute.
Sebagai contoh, kita bina class LoginForm, seperti berikut,
public class LoginForm {
    private String username;
    private String password;

    public LoginForm() {}

    public LoginForm(String username, String password) {
        this.username = username;
        this.password = password;
    }

    // dan method-method lain seperti setter dan getter
}

Kemudian tambah method pada controller untuk mengambil input, seperti berikut,
    @PostMapping("/login")
    public String authenticate(@ModelAttribute LoginForm loginForm) {
        return "page";
    }

Path dan HTTP method perlu sama dengan code HTML untuk form tersebut, iaitu,


Untuk test controller, kita bina satu page untuk memaparkan username.
Edit page.mustache untuk page dashboard:
    ...
    {{#home}}{{> home}}{{/home}}
    {{#login}}{{> login}}{{/login}}
    {{#dashboard}}{{> dashboard}}{{/dashboard}}
    ...

kemudian, bina file dashboard.mustache:
{{#success}}
  Selamat datang, {{username}}!
{{/success}}
{{^success}}
  Maaf, password tak betul.
{{/success}}

Akhir sekali, edit method authenticate() untuk menghantar data yang
diperlukan:
    @PostMapping("/login")
    public String authenticate(@ModelAttribute LoginForm loginForm, Model model) {
        boolean success = loginForm.getUsername().equals("admin") &&
                loginForm.getPassword().equals("admin");

        model.addAttribute("title", "Dashboard");
        model.addAttribute("dashboard", true);
        model.addAttribute("success", success);
        model.addAttribute("username", loginForm.getUsername());
        return "page";
    }


Amaran keras! Dalam website sebenar, jangan sesekali membandingkan
password seperti code di atas, sebaliknya, gunakan cryptography.

Untuk test, kita boleh login menggunakan username admin dan password admin.
Data transfer object (DTO)
Ini adalah maklumat tambahan. Kita telah melihat sebelum-sebelum ini kita
membuat class untuk menempatkan data input daripada pengguna seperti class
LoginForm di atas. Ini adalah salah satu daripada design pattern yang
dinamakan data transfer object(DTO).

springmvc/redirect.html.body:
Redirect
Dalam tutorial Form, selepas login, cuba klik Refresh pada browser.
Browser kemudian akan bertanya sama ada ingin menghantar form semula ataupun
tidak. Ada sesetengah masa, kita tidak mahu menghantar form semula. Untuk itu,
kita boleh menggunakan redirect.
Redirect ialah cara browser menghantar pengguna ke page yang lain. Dengan
menggunakan Spring MVC, kita ada dua pilihan untuk membuat redirect. Kita akan
melihat kedua-dua cara tersebut.
Sebelum itu, kita edit dahulu page Dashboard kerana kita masih tiada akses ke
username.
File dashboard.mustache:
Selamat datang ke Dashboard!

dan tambah controller untuk melihat page tersebut:
    @GetMapping("/dashboard")
    public String dashboard(Model model) {
        model.addAttribute("title", "Dashboard");
        model.addAttribute("dashboard", true);
        return "page";
    }

Sekarang kita akan melihat cara untuk redirect ke page Dashboard setelah login.
Meta refresh
Cara yang pertama adalah dengan menambah meta pada HTML, iaitu,


Meta di atas bermaksud redirect ke /dashboard selepas 3 saat. Kita boleh
menambah message untuk memberitahu pengguna bahawa mereka akan redirect ke page
Dashboard. Sebagai contoh, kita bina file login_success.mustache:



    Website Hello



    Website Hello

    Anda telah berjaya login.
    Anda akan dihantar ke Dashboard dalam masa 3 saat.



Untuk controller, kita paparkan page login_success.mustache setelah berjaya
login, jika gagal kita paparkan login form semula. Contohnya,
    @PostMapping("/login")
    public String authenticate(@ModelAttribute LoginForm loginForm, Model model) {
        boolean success = loginForm.getUsername().equals("admin") &&
                loginForm.getPassword().equals("admin");

        if (success) {
            return "login_success";
        }

        return login(model);
    }

redirect:
Cara yang kedua adalah dengan menggunakan cara redirect daripada Spring MVC,
iaitu dengan memulangkan string bermula "redirect:" kemudian url page. Contohnya,
    @PostMapping("/login")
    public String authenticate(@ModelAttribute LoginForm loginForm, Model model) {
        boolean success = loginForm.getUsername().equals("admin") &&
                loginForm.getPassword().equals("admin");

        if (success) {
            return "redirect:/dashboard";
        }

        return login(model);
    }

Dengan cara ini, pengguna akan terus ke page dashboard. Cuba refresh browser
setelah berjaya login.

springsecurity/.body:
Spring Security
Spring Security ialah framework yang memberi kemudahan seperti password
encryption, pengesahan identiti serta password (authentication), pemberian
akses untuk ahli website (authorization), dan lain-lain. Semua kemudahan
tersebut boleh ditulis sendiri oleh programmer. Namun, bagi mengelakkan
kecuaian, Spring terus menyediakan framework security untuk mengendalikan
kesemuanya.
Jika anda ada mengikuti tutorial Spring MVC, saya
telah membuat beberapa perubahan pada GreetingController sebagai persediaan
untuk tutorial ini, seperti berikut,
@Controller
public class GreetingController {
    @GetMapping("/")
    public String home(Model model) {
        return render(model, "home", null);
    }

    @GetMapping("/login")
    public String login(Model model) {
        return render(model, "login", "Log In");
    }

    @GetMapping("/dashboard")
    public String dashboard(Model model) {
        return render(model, "dashboard", "Dashboard");
    }

    private String render(Model model, String filename, String title) {
        model.addAttribute(filename, true);
        model.addAttribute("title", title);
        return "page";
    }
}

Disebabkan code untuk pemilihan page selalu sangat berulang, maka, saya asingkan
code tersebut ke dalam method render(). Anda juga boleh buat cara yang sama
untuk mengemaskan code anda.
Tambah dependency
Framework Spring Security hanyalah sebuah library. Maka, mudah sahaja. Tambah
dependency tersebut dalam file pom.xml:

            org.springframework.boot
            spring-boot-starter-security


Anda juga boleh menggunakan Spring Initializr untuk
generate projek yang mengandungi Spring Security.

springsecurity/password-hashing.html.body:
Password Hashing
Sebelum kita melihat maksud hash, kita akan menulis code terlebih dahulu.
Kemudian, kita akan melihat penjelasan.
Mula-mula, kita perlu membina class untuk meletakkan configuration. Kita
namakan class tersebut Config, kemudian tambah annotation @Configuration,
seperti berikut,
package com.jombelajarjava.hello;

import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;
import org.springframework.security.crypto.bcrypt.BCryptPasswordEncoder;
import org.springframework.security.crypto.password.PasswordEncoder;

@Configuration
public class Config {
}

Dalam configuration, kita akan memilih algorithm untuk membuat hashing. Kita
akan pilih BCrypt. Jadi, kita tambah method seperti berikut,
@Configuration
public class Config {
    @Bean
    public PasswordEncoder passwordEncoder() {
        return new BCryptPasswordEncoder();
    }
}

Annotation @Bean tersebut adalah untuk Spring. Nanti apabila kita meletakkan
parameter PasswordEncoder menggunakan @Autowired, Spring akan membuat
dependency injection. Konsep ini sama seperti @Provider dalam Google Guice.
Untuk test algorithm BCrypt, kita boleh bina controller tambahan hanya untuk
test. Contoh,
File test.mustache:
Result: {{result}}

File TestController.java:
